import './App.css';
import { Routes, Route } from 'react-router-dom'
import HomePage from './Pages/HomePage';
import AddProduct from './Pages/AddProduct';
function App() {
  return (
    <>
      <Routes>
        <Route path='/' element={<HomePage />} />\
        <Route path='/add-product' element={<AddProduct />} />
      </Routes>
    </>
  );
}

export default App;
